import React, { useState, useRef } from 'react';
import { Upload, Check, X } from 'lucide-react';

const FileUpload = () => {
  const [file, setFile] = useState(null);
  const [error, setError] = useState('');
  const [uploading, setUploading] = useState(false);
  const [uploadProgress, setUploadProgress] = useState(0);

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setError('');
    setUploadProgress(0);
    
    if (selectedFile) {
      // Check file size (e.g., max 5MB)
      if (selectedFile.size > 5 * 1024 * 1024) {
        setError('File size should be less than 5MB');
        return;
      }
      
      // Check file type
      const allowedTypes = ['application/pdf', 'application/msword', 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'];
      if (!allowedTypes.includes(selectedFile.type)) {
        setError('Please upload PDF or Word documents only');
        return;
      }
      
      setFile(selectedFile);
    }
  };

  const saveDocument = async () => {
    try {
      setUploading(true);
      const formData = new FormData();
      formData.append('file', file);

      const response = await fetch('http://localhost:5000/upload', {
        method: 'POST',
        body: formData,
      });

      const data = await response.json();
      
      if (response.ok) {
        console.log('File uploaded successfully:', data.fileUrl);
        setUploadProgress(100);
        alert("Successful doen")
        // You might want to store the fileUrl or show a success message
      } else {
        setError(data.error || 'Upload failed');
        setUploadProgress(0);
      }
    } catch (err) {
      setError('Upload failed: Network error');
      console.error('Error:', err);
    } finally {
      setUploading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      {/* Header */}
      <div className="text-center mb-6">
        <h1 className="text-2xl font-bold text-gray-800">Document Upload</h1>
        <p className="text-sm text-gray-600">Upload documents to Backblaze B2</p>
      </div>

      {/* Error Message */}
      {error && (
        <div className="bg-red-50 border border-red-200 text-red-600 px-4 py-3 rounded-lg mb-4">
          {error}
        </div>
      )}

      {/* File Upload Section */}
      <div className="bg-white rounded-lg shadow-md p-4 mb-4">
        <div className="border-2 border-dashed border-gray-300 rounded-lg p-4">
          <input
            type="file"
            onChange={handleFileChange}
            className="hidden"
            id="file-upload"
            accept=".pdf,.doc,.docx"
          />
          <label
            htmlFor="file-upload"
            className="flex flex-col items-center cursor-pointer"
          >
            <Upload className="w-8 h-8 text-blue-500 mb-2" />
            <span className="text-sm text-gray-600">
              {file ? file.name : 'Tap to upload document'}
            </span>
          </label>
        </div>
      </div>

      {/* Upload Progress */}
      {uploadProgress > 0 && (
        <div className="mb-4">
          <div className="w-full bg-gray-200 rounded-full h-2.5">
            <div
              className="bg-blue-500 h-2.5 rounded-full transition-all duration-300"
              style={{ width: `${uploadProgress}%` }}
            ></div>
          </div>
        </div>
      )}

      {/* Action Buttons */}
      <div className="fixed bottom-0 left-0 right-0 p-4 bg-white border-t">
        <button
          onClick={saveDocument}
          disabled={!file || uploading}
          className={`w-full py-3 rounded-lg flex items-center justify-center space-x-2
            ${
              file && !uploading
                ? 'bg-blue-500 text-white hover:bg-blue-600 transition-colors'
                : 'bg-gray-300 text-gray-500'
            }`}
        >
          {uploading ? (
            <>
              <span className="animate-spin mr-2">⟳</span>
              <span>Uploading...</span>
            </>
          ) : (
            <>
              <Check className="w-5 h-5" />
              <span>Save</span>
            </>
          )}
        </button>
      </div>
    </div>
  );
};

export default FileUpload;
